import React from 'react';
import { FaUserMd, FaMoneyBillWave, FaMicrochip, FaHospitalAlt } from 'react-icons/fa';

function HealthCare() {
  return (
    <div className="min-h-screen bg-white text-gray-800 font-sans">
      {/* Hero Section */}
      <section className="text-center py-16 px-4">
        <h2 className="text-5xl font-light">Healthcare Transformation Solutions</h2>
        <p className="mt-4 text-dark max-w-2xl mx-auto">
          Transforming healthcare with AI, XR, and Digital Learning to solve workforce gaps, control cost, & boost patient engagement through immersive, intelligent, & scalable solutions.
        </p>
        <h1 className="mt-4 max-w-2xl mx-auto text-xl font-medium">Explore the Transformation Landscape</h1>
      </section>

      {/* Stats Section */}
      <section className="grid grid-cols-2 md:grid-cols-4 gap-6 max-w-6xl mx-auto px-4 py-12 text-center">
        {[
          { label: 'Executives prioritize AI', value: '77%' },
          { label: 'Worker shortage by 2027', value: '100K+' },
          { label: 'Market growth by 2027', value: '46B' },
          { label: 'Medical schools using AI', value: '68%' },
        ].map((stat, index) => (
          <div key={index}>
            <h3 className="text-3xl font-bold">{stat.value}</h3>
            <p className="text-sm text-gray-600 mt-2">{stat.label}</p>
          </div>
        ))}
      </section>

      {/* Industry Challenges Section */}
      <section className="bg-gray-50 py-12 px-4">
        <div className="max-w-6xl mx-auto">
          <h2 className="text-3xl font-semibold mb-2">Industry Challenges & Priorities</h2>
          <h3 className="text-xl font-light mb-4">Overview</h3>

          <p className="text-gray-600 mb-12 max-w-3xl">
            The healthcare industry is evolving through AI, XR, & digital learningâ€”driving smarter care, cost efficiency, & better patient engagement.
            Amid workforce & tech challenges, digital solutions empower providers to innovate, improve outcomes, & scale resiliently.
          </p>

          <h3 className="text-xl font-semibold mb-6">Critical Challenges</h3>

          <div className="grid md:grid-cols-2 gap-6">
            <ChallengeCard
              icon={<FaUserMd className="text-purple-600 text-3xl ml-4" />}
              title="Workforce Crisis"
              description="100K+ critical worker shortage by 2028, 50% burnout rate persists"
            />
            <ChallengeCard
              icon={<FaMoneyBillWave className="text-purple-600 text-3xl ml-4" />}
              title="Financial Pressure"
              description="8% cost increases, <2% operating margins, $100B underpayment gap"
            />
            <ChallengeCard
              icon={<FaMicrochip className="text-purple-600 text-3xl ml-4" />}
              title="Technology Gaps"
              description="180+ ransomware attacks, 137TB daily data, workflow inefficiencies"
            />
            <ChallengeCard
              icon={<FaHospitalAlt className="text-purple-600 text-3xl ml-4" />}
              title="Access Barriers"
              description="26-day wait times, 4 in 10 can't afford care, cost-driven skipping"
            />
          </div>
        </div>
      </section>

      {/* Strategic Priorities 2025 Section */}
      <section className="py-12 px-4">
        <h2 className="text-3xl font-semibold text-gray-800 text-center mb-8">Strategic Priorities 2025</h2>
        <div className="max-w-4xl mx-auto">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-4">
            <StatBox value="65%" label="Revenue Growth" />
            <StatBox value="55%" label="Consumer Experience" />
            <StatBox value="55%" label="AI & Technology" />
          </div>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <StatBox value="70%" label="Workforce Development" />
            <StatBox value="60%" label="Cybersecurity" />
          </div>
        </div>
      </section>
    </div>
  );
}

// Components
function ChallengeCard({ icon, title, description }) {
  return (
    <div className="bg-white p-6 rounded-xl shadow flex items-center justify-between">
      <div>
        <h4 className="text-lg font-bold mb-1">{title}</h4>
        <p className="text-gray-600 text-sm">{description}</p>
      </div>
      {icon}
    </div>
  );
}

function StatBox({ value, label }) {
  return (
    <div className="h-[100px] border rounded shadow flex flex-col justify-center items-center">
      <h2 className="font-semibold mb-1 text-purple-600 text-xl">{value}</h2>
      <p className="text-sm text-center">{label}</p>
    </div>
  );
}

export default HealthCare;
